import {Crud} from "./Crud";
import {useEffect, useState} from "react";
import axios from "axios";
import {BASE_URL, CONFIG} from "../service/Api-Call";
import Swal from "sweetalert2";
import {Carousel} from "../childcomponents/Carousel";
import {CarouselCard} from "../childcomponents/CarouselCard";
import {Outbit} from "../childcomponents/Outbit";

export const BestUsers = () => {
    const [auction, setAuction] = useState(null);

    function setToArray(data) {
        let arr = [];
        for (let i = 0; i < data.length; i++) {
            let tempArr = []
            tempArr.push(data[i][0])
            tempArr.push(data[i][3] + " " + data[i][4])
            tempArr.push(data[i][1])
            tempArr.push(data[i][9])
            arr.push(tempArr)
        }
        return arr;
    }

    useEffect(() => {
        axios.get(`${BASE_URL}/enchere/8`).then((response) => {
            setAuction(response.data.data)
            console.log(response.data.data)
        }).catch((error) => {
                Swal.fire({
                    icon: 'error',
                    title: 'Désolé...',
                    text: error.response.data.code + ': ' + error.response.data.message,
                })
            }
        )
    }, [])
    const headers = [
        "ID",
        "Utilisateur",
        "Montant dépensé",
        "Date d'intégration"
    ]
    const names = [
        "id",
        "utilisateur",
        "montantdepense",
        "dateintegration"
    ]
    const textValues =
        {
            ajouter: "Ajouter un utilisateur",
            modifier: "Accepter le utilisateur",
            supprimer: "Supprimer l'utilisateur",
            btnCreer: "Créer",
        }
    return (
        //     container and row
        <div className="container">
            <div className="row">
                {/*            col-xl and col-md 8 and everything else is 12*/}
                <div className="col-xl-8 col-md-8 col-12">
                    <Carousel/>
                </div>
                <div className="col-xl-4 col-md-4 col-12">
                    <CarouselCard data={auction}/>
                </div>
            </div>
            <div className="row">
                <div className="col-12">
                    <Outbit/>
                </div>
            </div>
        </div>
    )
}
